    useEffect(()=>{
        getAllProducts()
    },[])


    const getAllProducts= async ()=>{
       const response = await axios.get(`${endPoint}product-all`)
       setProducts(response.data);
    }
    

  return (

        
        
    <div className="card" > 

    
    <div className="card-body center" >{products.map((e) => (
        <div className="card" style={{width: "18rem"}}>
